module.exports.handleEvent = async ({ event, api }) => {
  const { threadID, senderID } = event;
  if (!rankData[threadID]) rankData[threadID] = {};
  if (!rankData[threadID][senderID]) {
    rankData[threadID][senderID] = { exp: 0, level: 1, notify: true };
  }

  const userRank = rankData[threadID][senderID];
  userRank.exp += 1;
  const neededExp = userRank.level * 10;

  if (userRank.exp >= neededExp) {
    userRank.level++;
    userRank.exp = 0;

    if (userRank.notify) {
      try {
        const info = await api.getUserInfo(senderID);
        const name = info[senderID]?.name || "NgÆ°á»i dÃ¹ng";

        const attachments = global.vdtrai?.length > 0 ? global.vdtrai.splice(0, 1) : [];

        api.sendMessage({
          body: `ğŸ‰ [Cáº¤P Äá»˜] ${name} vá»«a lÃªn cáº¥p ${userRank.level}!`,
          attachment: attachments
        }, threadID, (err, info) => {
          if (err) return;
          setTimeout(() => {
            api.unsendMessage(info.messageID);
          }, 10000); // thu há»“i sau 10 giÃ¢y
        });
      } catch (e) {
        console.error("Lá»—i gá»­i áº£nh level up:", e);
        api.sendMessage(`ğŸ‰ [Cáº¤P Äá»˜] NgÆ°á»i dÃ¹ng ${senderID} vá»«a lÃªn cáº¥p ${userRank.level}!`, threadID);
      }
    }
  }

  fs.writeFileSync(path, JSON.stringify(rankData, null, 2));
};

module.exports.run = async ({ event, api, args, Threads, Users }) => {
  const { threadID, senderID, messageID, mentions } = event;
  const thread = rankData[threadID] || {};
  const mentionID = Object.keys(mentions)[0];
  const send = msg => api.sendMessage(msg, threadID, messageID);

  if (!args[0]) {
    return send(`ğŸ“š HÆ°á»›ng dáº«n sá»­ dá»¥ng lá»‡nh rank:

â€¢ rank check / rank @tag: Xem cáº¥p Ä‘á»™ cá»§a báº¡n hoáº·c ngÆ°á»i khÃ¡c.
â€¢ rank toggle: Báº­t/táº¯t thÃ´ng bÃ¡o khi lÃªn cáº¥p.
â€¢ rank top: Hiá»ƒn thá»‹ top 10 ngÆ°á»i cÃ³ cáº¥p cao nháº¥t trong nhÃ³m.
â€¢ rank global: Hiá»ƒn thá»‹ top 10 ngÆ°á»i cÃ³ cáº¥p cao nháº¥t toÃ n bot.
â€¢ rank reset -t / thread: Reset dá»¯ liá»‡u rank nhÃ³m nÃ y.
â€¢ rank reset global: Reset toÃ n bá»™ dá»¯ liá»‡u rank (chá»‰ admin bot).

ğŸ“ˆ EXP tÄƒng má»—i khi báº¡n gá»­i tin nháº¯n.
ğŸ”¼ LÃªn cáº¥p má»—i khi Ä‘áº¡t EXP = cáº¥p Ã— 10.`);
  }

  switch (args[0].toLowerCase()) {
    case "check": {
      const id = mentionID || senderID;
      if (!thread[id]) return send("âŒ NgÆ°á»i nÃ y chÆ°a cÃ³ dá»¯ liá»‡u rank.");
      const name = (await Users.getNameUser(id)) || "NgÆ°á»i dÃ¹ng";
      const { level, exp } = thread[id];
      const maxExp = level * 10;
      return send(`ğŸ“Š Rank cá»§a ${name}:\n\nğŸ’¬ Tin nháº¯n: ${exp}/${maxExp}\nğŸ“ˆ Cáº¥p Ä‘á»™: ${level}`);
    }

    case "toggle": {
      if (!thread[senderID]) return send("âŒ Báº¡n chÆ°a cÃ³ dá»¯ liá»‡u Ä‘á»ƒ báº­t/táº¯t.");
      thread[senderID].notify = !thread[senderID].notify;
      fs.writeFileSync(path, JSON.stringify(rankData, null, 2));
      return send(thread[senderID].notify ? "âœ… ÄÃ£ báº­t thÃ´ng bÃ¡o khi lÃªn cáº¥p." : "ğŸ”• ÄÃ£ táº¯t thÃ´ng bÃ¡o khi lÃªn cáº¥p.");
    }

    case "top": {
      const top = Object.entries(thread)
        .sort(([, a], [, b]) => b.level - a.level || b.exp - a.exp)
        .slice(0, 10);
      const list = await Promise.all(
        top.map(async ([uid, data], i) => {
          const name = await Users.getNameUser(uid);
          return `${i + 1}. ${name}: Lv ${data.level} (${data.exp} EXP)`;
        })
      );
      return send(`ğŸ† Top 10 ngÆ°á»i cÃ³ cáº¥p Ä‘á»™ cao nháº¥t:\n\n${list.join("\n")}`);
    }

    case "global": {
      const globalTop = Object.entries(rankData)
        .flatMap(([tid, users]) => Object.entries(users).map(([uid, data]) => ({ uid, data })))
        .sort((a, b) => b.data.level - a.data.level || b.data.exp - a.data.exp)
        .slice(0, 10);
      const list = await Promise.all(
        globalTop.map(async ({ uid, data }, i) => {
          const name = await Users.getNameUser(uid);
          return `${i + 1}. ${name}: Lv ${data.level} (${data.exp} EXP)`;
        })
      );
      return send(`ğŸŒ Top 10 toÃ n há»‡ thá»‘ng:\n\n${list.join("\n")}`);
    }

    case "reset": {
      if (!args[1]) return send("â— DÃ¹ng: rank reset global hoáº·c rank reset -t/thread");

      if (args[1] === "global") {
        if (!adminIDs.includes(senderID)) return send("âš ï¸ Chá»‰ admin bot má»›i cÃ³ thá»ƒ reset toÃ n bá»™!");
        rankData = {};
        fs.writeFileSync(path, JSON.stringify(rankData, null, 2));
        return send("ğŸ—‘ï¸ ÄÃ£ reset toÃ n bá»™ dá»¯ liá»‡u rank!");
      }

      if (["-t", "thread"].includes(args[1])) {
        delete rankData[threadID];
        fs.writeFileSync(path, JSON.stringify(rankData, null, 2));
        return send("ğŸ§¹ ÄÃ£ reset rank cá»§a nhÃ³m nÃ y!");
      }

      return send("â“ Lá»‡nh khÃ´ng há»£p lá»‡.");
    }

    default:
      return send("â“ Lá»‡nh khÃ´ng há»£p lá»‡. Nháº­p `rank` Ä‘á»ƒ xem hÆ°á»›ng dáº«n sá»­ dá»¥ng.");
  }
};

